import API from "src/axios/axios";

export const getProductApi = (param, row) => {
  let url = `get-all-chairs/${row}`;
  console.log(param);
  if (param) {
    const page = param.split("?")[1];
    url = `get-all-chairs?${page[1]}`;
    console.log(page);
  }
  console.log(url);
  return API.get(url);
};
